import React from 'react';
import PropTypes from 'prop-types';

const propTypes = {};

const defaultProps = {};

/**
 * 
 */

const styles = {
    backgroundColor: "black",
    padding: "2px",
    color: "#979494"
}

const navList = {
    display: "flex"

}

const navListItem = {
    marginRight: "1em",
    padding: "1rem",
    border: "1px white solid"
}


const NavBar = () => {
    return <nav style={styles}>
        <div style={navList}>
            <h2 style={navListItem}>DT</h2>
            <h4 style={navListItem}>Home</h4>
            <h4 style={navListItem}>About</h4>
            <h4 style={navListItem}>Projects</h4>
            <h4 style={navListItem}>Contacts</h4>
            <h4 style={navListItem}>Resume</h4>
        </div>
    </nav>;
}

NavBar.propTypes = propTypes;
NavBar.defaultProps = defaultProps;
// #endregion

export default NavBar;
